import "./Users.css";

const Users = (props) => {
  const [userArray, setUserArray] = useState();

  let userList = [];

  let content = <p>No Current Users</p>;

  if (userArray.length > 0) {
    content = userList;
  }

  return <ul>{content}</ul>;
};

export default Users;
